    OML_CLASSES_WA1;

%script

create table 
    OML_CLASSIFICATION_SET_WA1 (setting_name  varchar2(100), setting_value varchar2(4000));

%script

drop table
    OML_CLASSIFICATION_SET_WA1;

%script

begin       

    insert into OML_CLASSIFICATION_SET_WA1 (setting_name, setting_value) 
        values (dbms_data_mining.prep_auto, dbms_data_mining.prep_auto_on);

    insert into OML_CLASSIFICATION_SET_WA1 (setting_name, setting_value) 
        values (dbms_data_mining.algo_name, dbms_data_mining.algo_decision_tree);

end;

%script

begin

dbms_data_mining.DROP_MODEL(
    model_name        => 'OML_CLASSIFICATION_MOD_WA1'
    );

end;

